import styled from "styled-components";

const StyledRoomDisabled = styled.div`
  display: flex;
  flex-direction: column;
  min-width: 140px;
  border-style: solid;
  border-color: #b8b8b8;
  border-radius: 5px;
  margin-bottom: 10px;
  margin-right: 10px;
`;

export default StyledRoomDisabled;
